export interface ILocalizacao {
    id?: string;
    endereco?: string;
    numero?: number;
    qtdReservada?: string;
    qtdTotais?: number;
}

export class Localizacao implements ILocalizacao {
    constructor(
        public id?: string,
        public endereco?: string,
        public numero?: number,
        public qtdReservada?: string,
        public qtdTotais?: number
    ) {}
}
